import { Section, Typography } from "@toptal/picasso";

import ContentRightTable from "./components";

const ContentRight = () => {
  return (
    <Section
      title={
        <Typography variant="heading" size="xlarge">
          Heroes
        </Typography>
      }
      variant="bordered"
    >
      <ContentRightTable />
    </Section>
  );
};

export default ContentRight;
